import React from 'react';
import "./PreFooter.css";

export default function PreFooter(props) {
  function total(){
    let sum = 0;
    props.newarr.forEach((val)=>{
        sum += (val.price * val.quantity);
    })
    return sum;
  }
  return (
    <div>
      <div><b>TOTAL AMOUNT IS: </b>Rs. {total()}</div>
      <button>GO TO CART</button>
    </div>
  )
}
